import React from "react";
import './MoviesList.css';
import MovieCard from '../../../cards/moviecard/MovieCard'

function MoviesList() {

    const movies = [
        {   
            key:1,
            name: 'Harry Potter',
            image: 'https://media.harrypotterfanzone.com/philosophers-stone-20-years-of-movie-magic-harry-poster.jpg'
        },
        {
            key:2,
            name: 'Black Panther',
            image: 'https://www.washingtonpost.com/graphics/2019/entertainment/oscar-nominees-movie-poster-design/img/black-panther-web.jpg'
        },
        {
            key:3,
            name: 'Star Wars',
            image: 'https://www.digitalartsonline.co.uk/cmsdata/slideshow/3662115/star-wars-last-jedi-poster.jpg'
        }
    ]

    return ( 
        <React.Fragment>

            <h3>Movies list:</h3>

            <div className="movieslist-container">

                {movies.map(element => {
                    return(
                    <MovieCard movie={element}/>
                    )
                })}

            </div>

        </React.Fragment>
     );
}

export default MoviesList;
